var tipuesearch = {"pages":[{"text":"1.在Github帳號建立一個倉儲名稱定為2016springcd_aG6 2.修改為40323152 README.md後，git clone到2016springcd_aG6，將自己的學號與個人對應的 Github Page 網頁, 放入 REAEME.md 檔案中 3.用自己的github推送上去 4.放入 2016springcd_xGx 倉儲並寫一份專案報告 5.交上課交的2D繪圖繪製一簡單幾何零件圖形 6.用onshape繪製一個正齒輪，並將其囓合組立，將組合建設為公開，將連結寫入對應的資料區即可 心得:今天的進度必須交上課教的東西全部都利用而繪製出2D和3D的齒輪，並將其囓合組立才可完成。組員必須完成自己的齒輪，所以組員間會互相幫助完成這次的進度並打上報告","url":"http://cdw18-ag100.rhcloud.com/static/blog/40323152-qi-mo-kao-zhou-zhuan-an-bao-gao.html","title":"40323152 期末考週專案報告","tags":"ag6"},{"text":"今天要做的事很多， 1.要先找組裡的一個人建立倉儲，然後，把其他組員加進來。 2.每個人都git clone下來，修改README檔案。 3.取得老師倉儲的架構，並建立一個自我期末報告的網誌 4.然後利用老師教我們的2D繪圖，每個人都畫一個簡單幾何零件圖形，在代表的人的OpenShift上呈現。 5.再來要用Onshape，每一個人都要畫一個正齒輪，完成嚙合組立，將組合件設為公開，最後將各個連結放入對應資料區就完成了。 心得；今天做的東西應用到這學期學到的所有東西，做起來是需要整組的人通力合作才可以完成的","url":"http://cdw18-ag100.rhcloud.com/static/blog/40323147-qi-mo-kao-zhou-zhuan-an-bao-gao.html","title":"40323147 期末考週專案報告","tags":"ag6"},{"text":"今天需要做的是有下面的六項: 1.推派代表建立組別的倉儲 2.修改README.md將GITHUB PAGE的網址貼上 3.接著使用自己的學號推送上去 4.取得2016springcd_final倉儲的架構並寫一份專案報告 5.用上課交的2D繪圖的方式繪製簡單圖形並推送上去 6.每人分別建立齒數不同的齒輪並組裝在一起 心得: 今天突然要做這一些測試有點震驚，因為前陣子才花很多間在做這個，有點擔心四節課做不做得完，所以做的很緊張。","url":"http://cdw18-ag100.rhcloud.com/static/blog/40323155-qi-mo-kao-zhou-zhuan-an-bao-gao.html","title":"40323155 期末考週專案報告","tags":"ag6"},{"text":"今天的專案報告要做的事情有: 1.建立自己組別的倉儲 2.使用自己的學號修改README.md檔案 3.將自己學號推送上去 4.打一份專案報告並推送到gh-pages分支中 5.繪製簡單的圖形呈現在網頁並將連結放進README.md中 6.組員分別建立齒輪並全部組立在一起 心得: 今天是測試之前所學習的東西會不會做，一開始聽到有點嚇到不過還是一步一步的做出來","url":"http://cdw18-ag100.rhcloud.com/static/blog/40323156-qi-mo-kao-zhou-zhuan-an-bao-gao.html","title":"40323156 期末考週專案報告","tags":"ag6"},{"text":"為了能夠更客觀進行各組與各學員的期末自評, 特別以組為單位, 各組員為內容建構成員, 利用四堂課程的時間, 在各組新建的 Github 倉儲中完成此一專案報告. 基本專案建置流程: 請各組推派代表, 在其 Github 帳號下, 建立一個分組期末專案倉儲, 倉儲名稱定為 2016springcd_aG1, 其中的 aG1 代表 a 班的第 1 組 (以下將以 2016springcd_xGx 代表各組建立的倉儲名稱), 請各組自行配合改為各自的組別代號, 而且請各組特別注意, 此一倉儲的建立時間, 必須是在各班期末考週的第1堂課程時間之後建立, 才納入計分. 倉儲建立之後的第1階段提交推送資料, 必須是修改 README.md, 而且必須透過協調, 由各組員依序 git clone 各組在代表組員帳號下所建立的 2016springcd_xGx 倉儲後, 分別由各組員自行用學號登錄的 github 帳號以協同提交推送的過程, 各自修改 README.md 檔案, 將自己的學號與個人對應的 Github Page 網頁, 放入 REAEME.md 檔案中. 第2項的評分依據為各組員必須自行用自己在 Github 登錄的帳號, 取得各組的 2016springcd_xGx 倉儲協同權限後, 再進行 RADEME.md 的協同修改, 之後各組員完成提交推送的紀錄, 必須可以在 commits 呈現各自的學號與提交推送內容及時間, 才納入計分. 各組以協同流程完成 README.md 的編修後, 接著請取用 https://github.com/2015fallhw/2016springcd_final 倉儲中的架構, 在各組的代表成員的 2016springcd_xGx 倉儲中運作, 並設法將其中的 pelican 網誌內容, 呈現在 2016springcd_xGx 倉儲的 gh-pages 分支中, 完成後, 請各組員在此一 gh-pages 倉儲中各自建立一個能夠呈現自我期末報告的網誌, 並且將此一在 2016springcd_xGx 倉儲的 gh-pages 分支中的連結, 放入 2016springcd_xGx 倉儲 master 分支的 README.md 最前方. 接著, 請利用協同產品設計實習課程所學到的 2D 網際繪圖內容, 以分組組員各自繪製一簡單幾何零件圖形的方式, 將 2016springcd_xGx 倉儲資料中的 wsgi 程式, 送到各組代表成員的 OpenShift 網站中呈現, 並將 2D 繪圖程式連結, 放到 2016springcd_xGx 倉儲 master 分支的 README.md 資料中, 並且放在分組 gh-pages 連結之後. 最後, 請各組以協同方式在 Onshape 雲端電腦輔助設計軟體中, 建立一個名稱為 2016springcd_xGx 的公開協同 Document, 然後將各組組員納入作為可以 edit 與 view 的協同者, 以每一位組員利用 Onshape 官方所釋出的 SG (正齒輪) FeatureScript, 分別依照學號排序, 從齒數 17 開始, 以每位學員遞增 2 齒的方式, 各自在 Part Studio 建立一個正齒輪零件, 並以學號命名零件後, 完成後, 以最簡單的方式在以組別 xGx 命名的組立件中完成囓合組立 (例如, 該組有 6 位成員, 則各自提供一個正齒輪零件, 齒數分別為 17, 19, 21, 23, 25, 27 等, 最後則完成6個齒輪的囓合組立), 完成後, 請將各組的囓合正齒輪組立件以 share 功能, 設定成網路公開組立件, 並將此一 Onshape 的組立件連結, 放到 2016springcd_xGx 倉儲 master 分支的 README.md 資料中, 放在分組 wsgi 2D 繪圖連結之後. 最最後, 請各組依序完成上述工作任務後, 將各組與各學員所完成的網站連結放入 https://github.com/2015fallhw/cdw11/wiki 各組員的對應資料區中, 以作為期末成績評分參考. 祝大家 2016 Summer 假期愉快!","url":"http://cdw18-ag100.rhcloud.com/static/blog/xie-tong-chan-pin-she-ji-shi-xi-qi-mo-kao-zhou-zhuan-an-bao-gao.html","title":"協同產品設計實習期末考週專案報告","tags":"ag100"}]};